import React from 'react';
import Typography from '@material-ui/core/Typography';
import Container from '@material-ui/core/Container';
import Grid from '@material-ui/core/Grid';
import TextField from '@material-ui/core/TextField';

function SignIn() {
  return (
    <div>
      <Container maxWidth='md'>
        <Grid xs={12}>
          <Grid>
            <Typography style={{marginTop : 40,fontSize : 25,fontWeight : 500}}>Izze admin Pannel</Typography>
            <div>
                <Typography style = {{marginTop : 10,fontSize : 20,fontWeight : 500}}>Login Here</Typography>
                <TextField style={{marginTop : 20,width : '50%'}} id="outlined-basic" label="Enter Email" variant="outlined" />
            </div>
          </Grid>
        </Grid>
      </Container>
    </div>
  );
}

export default SignIn;
